import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { Modal, Button, Card, Container, Row, Col } from 'react-bootstrap';
import { Link, useParams } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';

export default function Party() {
    
  let navigate = useNavigate();
  const { partyId } = useParams();
  const [party, setParty] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  
  if (sessionStorage.getItem("username") === "admin") {
    navigate("/admin");
    //window.location.href = '/admin';
  } else if (!sessionStorage.getItem("username")) {
    navigate("/");
    //window.location.href = '/';
  }
  useEffect(() => {
    async function fetchParty() {
        try {
          const response = await axios.get(`http://localhost:8080/parties/partyById/${partyId}`);
          setParty(response.data);
          setIsLoading(false);
        } catch (error) {
          console.error('Error fetching party:', error);
        }
      }
  
      fetchParty();
  }, [partyId]);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  ////////////return start here////////////////
  return (
    <Container fluid style={{ marginTop: '20px' }}>
      <Row>
        <Col xs={3} className='friendship'>
          <h2>Party</h2>
          <div className='Party'>
          {(() => {
            let member;
            for (let i = 1; i < 9; i++) {
                <p>aaaa</p>
                member = "member"+i;
                if(party.member == null){
                    <div key={member.id} className="friendCard">
                    <a href='#' style={{ textDecoration: "none" }}>
                        <div className="friend-info" style={{ display: 'flex', height: 'max-content' }}>
                        <div className="friend-details" style={{ width: "100%", lineHeight: "40px" }}>
                            <p className="username" style={{ fontSize: "14px", fontWeight: "bold", marginLeft: "10px" }}>{"Awaiting Party Memeber"}</p>
                        </div>
                        </div>
                    </a>
                    </div>
                }
                else{
                    <div key={member.id} className="friendCard">
                    <a href='#' style={{ textDecoration: "none" }}>
                        <div className="friend-info" style={{ display: 'flex', height: 'max-content' }}>
                        <div className="friend-avatar">
                            <img
                            src={
                                member.user.avatarPath ||
                                `https://ui-avatars.com/api/?name=${member.user.nickname}&background=007bff&color=fff`
                            }
                            style={{ width: "80px", height: "max-content", borderRadius: "50%" }}
                            alt="Friend Avatar"
                            className="avatar"
                            />
                        </div>
                        <div className="friend-details" style={{ width: "100%", lineHeight: "40px" }}>
                            <p className="username" style={{ fontSize: "14px", fontWeight: "bold", marginLeft: "10px" }}>{member.user.nickname}</p>
                        </div>
                        </div>
                    </a>
                    </div>
                }
            }
          })()}
          </div>
        </Col>

        <Col xs={8} className="discord-col" style={{ height: "80vh" }}>
          <div className="chat-window">
            <div className="chat-header">
            <h2>{party.raid.name}</h2>
            </div>
            <div className="conversation" id="scroll"></div>
            <div className="input-area">
              <input type="text" placeholder="Type a message" />
              {/*Send message */}
              <button>Send</button>
              {/* Button to open the emote modal */}
              <button>Emotes</button>
            </div>
          </div>
        </Col>
      </Row>
    </Container>
  );
}
